import React from 'react'

class ExpensesList extends React.Component{
    render(){
        return(
            <div className='IncomeMinusExpense'>
            {this.props.listOfExpenses.map(item=>{
                <li>{item}</li>
                })}
            </div>
        )
    }
}

export default ExpensesList
